import { NavLink } from "react-router-dom";
import "../Style/botones.css"


const Botones = () => {
    return (
        <header id="Menu">
            <button id="boton">
                <NavLink to="/Lista">List View</NavLink>
            </button>
            <button id="boton">
                <NavLink to="/Busqueda">Search</NavLink>
            </button>
                <NavLink id="botonClose" to="/"> 
                    <button>Close</button>
                </NavLink>
        </header>
    );
}

export default Botones;
